const axios = require('axios');
const cheerio = require('cheerio');
const vm = require('vm');

class DouyinSearchPage {
    constructor() {
        this.baseURL = 'https://so.douyin.com/';
        this.defaultParams = {
            search_entrance: 'aweme',
            enter_method: 'normal_search',
            innerWidth: '431',
            innerHeight: '814',
            reloadNavStart: String(Date.now()),
            is_no_width_reload: '1',
            keyword: '',
        };
        this.cookies = {};
        this.api = axios.create({
            baseURL: this.baseURL,
            headers: {
                'accept': 'text/html,application/xhtml+xml,application/xml;q=0.9,image/avif,image/webp,image/apng,*/*;q=0.8,application/signed-exchange;v=b3;q=0.7',
                'accept-language': 'id-ID,id;q=0.9',
                'referer': 'https://so.douyin.com/',
                'upgrade-insecure-requests': '1',
                'user-agent': 'Mozilla/5.0 (Linux; Android 10; K) AppleWebKit/537.36 (KHTML, like Gecko) Chrome/131.0.0.0 Mobile Safari/537.36',
            }
        });
        this.api.interceptors.response.use(res => {
            const setCookies = res.headers['set-cookie'];
            if (setCookies) {
                setCookies.forEach(c => {
                    const [name, value] = c.split(';')[0].split('=');
                    if (name && value) this.cookies[name] = value;
                });
            }
            return res;
        });
        this.api.interceptors.request.use(config => {
            if (Object.keys(this.cookies).length) {
                config.headers['Cookie'] = Object.entries(this.cookies).map(([k, v]) => `${k}=${v}`).join('; ');
            }
            return config;
        });
    }

    async initialize() {
        try {
            await this.api.get('/');
            return true;
        } catch {
            return false;
        }
    }

    async search({ query }) {
        try {
            await this.initialize();
            const params = { ...this.defaultParams, keyword: query, reloadNavStart: String(Date.now()) };
            const res = await this.api.get('s', { params });
            const html = res.data;
            const $ = cheerio.load(html);

            let scriptWithData = '';
            $('script').each((_, el) => {
                const text = $(el).html();
                if (text.includes('let data =') && text.includes('\"business_data\":')) {
                    scriptWithData = text;
                }
            });

            if (!scriptWithData) throw new Error('Script containing data not found.');

            const match = scriptWithData.match(/let\s+data\s*=\s*(\{[\s\S]+?\});/);
            if (!match) throw new Error('Unable to match data object.');

            const dataCode = `data = ${match[1]}`;
            const sandbox = {};
            vm.createContext(sandbox);
            vm.runInContext(dataCode, sandbox);

            const fullData = sandbox.data;
            const data = fullData?.business_data;

            if (!data) throw new Error('Tidak ada data ditemukan.');

            const awemeInfos = data.map(entry => entry?.data?.aweme_info).filter(Boolean);
            return awemeInfos;
        } catch (e) {
            throw e;
        }
    }
}

exports.run = {
    usage: ['douyinsearch'],
    hidden: ['dysearch'],
    use: 'cari video Douyin berdasarkan kata kunci',
    category: 'downloader',
    location: 'plugins/downloader/douyinsearch.js',
    premium: true,
    async: async (m, { kuromi }) => {
        const text = m.text || m.quoted?.text;
        if (!text) return m.reply(`Masukkan kata kunci!\nContoh: *${m.prefix + m.command} fifty fifty*`);

        try {
            await kuromi.sendReact(m.chat, '🕒', m.key);

            const douyin = new DouyinSearchPage();
            const videos = await douyin.search({ query: text });

            if (!videos || videos.length === 0) throw new Error('Tidak ada video ditemukan.');

            const selected = videos[Math.floor(Math.random() * videos.length)];
            const videoUrl = selected?.video?.play_addr?.url_list?.[0];
            const title = selected?.desc || 'Tanpa judul';

            if (!videoUrl) throw new Error('URL video tidak ditemukan.');

            const caption = `*DOUYIN SEARCH*\n\n• *Judul:* ${title}\n• *Request:* ${m.pushName}`;
            await kuromi.sendMedia(m.chat, videoUrl, m, { caption });

        } catch (e) {
            console.error(e);
            await m.reply(`Gagal mencari video: ${e.message}`);
        }
    }
};

